(function() {
  var bind_rating_stars, block_callback, check_fields_validity, disable_form_inputs, get_location, is_mobile_data, numeric_field_constraint, set_coords, set_error_for_invalid_fields, start_speed_test;

  bind_rating_stars = function() {
    var star_options;
    star_options = {
      stars: 7,
      min: 0,
      max: 7,
      step: 1,
      displayOnly: false,
      showClear: false,
      showCaption: false,
      size: 'sm'
    };
    return $('.rating-container input').each(function() {
      return $(this).rating(star_options);
    });
  };

  disable_form_inputs = function() {
    return $('#form-container .form-fields input').prop('disabled', true);
  };

  set_coords = function(position) {
    $('#submission_latitude').attr('value', position.coords.latitude);
    $('#submission_longitude').attr('value', position.coords.longitude);
    return $.ajax({
      url: 'home/get_location_data',
      type: 'POST',
      dataType: 'json',
      data: {
        latitude: position.coords.latitude,
        longitude: position.coords.longitude
      },
      success: function(data) {
        $("input[name='submission[address]']").attr('value', data['address']);
        $("input[name='submission[zip_code]']").attr('value', data['zip_code']);
        $('.test-speed-btn').prop('disabled', false);
        $('.location-warning').addClass('hide');
        $('#take_test').prop('disabled', false);
        $('#take_test').addClass('opacity-100');
        return $.getJSON('https://jsonip.com/?callback=?', function(result_data) {
          return $('#submission_ip_address').val(result_data.ip.split(',')[0]);
        });
      }
    });
  };

  block_callback = function(error) {
    return $('#error-geolocation').modal('show');
  };

  get_location = function() {
    if (navigator.geolocation) {
      return navigator.geolocation.getCurrentPosition(set_coords, block_callback);
    }
  };

  check_fields_validity = function() {
    var is_valid;
    is_valid = true;
    if (!$('#submission_monthly_price')[0].checkValidity()) {
      $('#submission_monthly_price').addClass('got-error');
      $('#price_error_span').removeClass('hide');
      is_valid = false;
    } else {
      $('#submission_monthly_price').removeClass('got-error');
      $('#price_error_span').addClass('hide');
    }
    if (!$('#submission_provider_down_speed')[0].checkValidity()) {
      $('#submission_provider_down_speed').addClass('got-error');
      $('#speed_error_span').removeClass('hide');
      is_valid = false;
    } else {
      $('#submission_provider_down_speed').removeClass('got-error');
      $('#speed_error_span').addClass('hide');
    }
    return is_valid;
  };

  is_mobile_data = function() {
    return $(".checkboxes-container input[name='submission[testing_for]']:checked").val() === 'Mobile Data';
  };

  start_speed_test = function() {
    return $('.test-speed-btn').on('click', function() {
      if (check_fields_validity()) {
        $('#testing_speed').modal('show');
        return setTimeout((function() {
          return $('#start_ndt_test').click();
        }), 200);
      }
    });
  };

  numeric_field_constraint = function() {
    return $('.numeric').keydown(function(e) {
      if ($.inArray(e.keyCode, [46, 8, 9, 27, 13, 110, 190]) !== -1 || e.keyCode === 65 && (e.ctrlKey === true || e.metaKey === true) || e.keyCode >= 35 && e.keyCode <= 40) {
        return;
      }
      if ((e.shiftKey || e.keyCode < 48 || e.keyCode > 57) && (e.keyCode < 96 || e.keyCode > 105)) {
        return e.preventDefault();
      }
    });
  };

  set_error_for_invalid_fields = function() {
    $('#submission_monthly_price').focusout(function() {
      if (!$('#submission_monthly_price')[0].checkValidity()) {
        $('#submission_monthly_price').addClass('got-error');
        return $('#price_error_span').removeClass('hide');
      } else {
        $('#submission_monthly_price').removeClass('got-error');
        return $('#price_error_span').addClass('hide');
      }
    });
    return $('#submission_provider_down_speed').focusout(function() {
      var is_valid;
      if (!$('#submission_provider_down_speed')[0].checkValidity()) {
        $('#submission_provider_down_speed').addClass('got-error');
        $('#speed_error_span').removeClass('hide');
        return is_valid = false;
      } else {
        $('#submission_provider_down_speed').removeClass('got-error');
        return $('#speed_error_span').addClass('hide');
      }
    });
  };

  $(function() {
    bind_rating_stars();
    disable_form_inputs();
    numeric_field_constraint();
    if (window.location.pathname === '/') {
      get_location();
      start_speed_test();
      set_error_for_invalid_fields();
    }
    $('[rel="tooltip"]').tooltip({
      'placement': 'top'
    });
    $('#testing_for_button').attr('disabled', true);
    $('.test-speed-btn').prop('disabled', true);
    $('#take_test').on('click', function() {
      $('.title-container').addClass('hidden');
      $('#form-container').removeClass('hide');
      $('#form-step-1 input').prop('disabled', false);
      $('#introduction').addClass('hide');
      return $('.home-wrapper').addClass('mobile-wrapper-margin');
    });
    $(".checkboxes-container input[name='submission[testing_for]']").on('change', function() {
      $(".checkboxes-container input[name='submission[testing_for]']").each(function() {
        return $(this).prop('checked', false);
      });
      $(this).prop('checked', true);
      return $('#testing_for_button').attr('disabled', !$(".checkboxes-container input[name='submission[testing_for]']").is(':checked'));
    });
    return $('#testing_for_button').on('click', function() {
      var testing_for;
      testing_for = $(".checkboxes-container input[name='submission[testing_for]']:checked").data('target');
      $(testing_for).removeClass('hide');
      $(testing_for + ' input').prop('disabled', false);
      $(testing_for + ' select').prop('disabled', false);
      return $('#form-step-1').addClass('hide');
    });
  });

}).call(this);
